import React from 'react';
import styled from "styled-components";

const Container = styled.div``;

const Wrapper = styled.div`
  padding: 50px;
  display: flex;
`;

export default function Register() {
  return (
    <Container>
        <Wrapper>
            <Title>Cre</Title>
        </Wrapper>
    </Container>
  );
};
